import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col'

import SearchLabelForm from './components/SearchLabelForm';
import ExecQueryBindingVarTable from './components/bindingVarTable/ExecQueryBindingVarTable';




const App = () => {
  return (
    <Container>
      <Row>
        <Col >
         <SearchLabelForm /> 
        </Col>
        <Col >
          <ExecQueryBindingVarTable />
        </Col>
      </Row>
    </Container>
  );
};

export default App;

